title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o15513.m19 -> o15506.m27 -> o15506.m25 -> o15529.m24 -> o15513.m19
  o15529.m24 -> o15513.m19 -> o15506.m27 -> o15506.m25 -> o15529.m24
  o15506.m25 -> o15529.m24 -> o15513.m19 -> o15506.m27 -> o15506.m25
  o15529.m0 -> o15506.m27 -> o15506.m25 -> o15529.m24 -> o15513.m19 -> o15506.m27
  o15529.m7 -> o15513.m19 -> o15506.m27 -> o15506.m25 -> o15529.m24 -> o15513.m19
  o15506.m27 -> o15506.m25 -> o15529.m24 -> o15513.m19 -> o15506.m27

features:
  - inheritance
  - overriding
  - method
  - polymorphism

